import ServicesCard from "./ServiceCard"

const ServicesSection = () => {

    return(
        <div className="service-section-container">
            <ServicesCard image={"/theme-changes-services.png"}/>
            <ServicesCard image={"/starter-shop-service.png"}/>
            <ServicesCard image={"/seo-op-service.png"}/>
        </div>
    )

}

export default ServicesSection
